import React from "react";
import Square from "./Square.js";

export default function Grid() {
  const grid = [];
  for (let row = 0; row < 9; row++) {
    grid.push([]);
    for (let col = 0; col < 9; col++) {
      grid[row].push(<Square />);
    }
  }
  return <div className="grid-board">{grid}</div>;
}
